Information
------------------------------

America The Wild: Monster Wolf
Wolves have been around for centuries, but with so many variations, what's really considered a wolf? Casey scours Canada's West Coast to investigate a rash of bold wolf behavior on Vancouver Island. He treks to Tofino, where wolves routinely push the limits of hunting and killing backyard pets -- but Casey wants to know if these so-called &quot;monster wolves&quot; are wolves at all. Then, in New Mexico, Casey observes differences between purebred wolves, hybrid wolves and the broad spectrum of wolf-dogs.

